                        hideSupper: false
                    },
                    {
                        permissionResource: 'admin-management',
                        title: "Normal admin",
                        page: "Users/normal-admin",
                        hideSupper: false
                    }
                ]
            },
            {
                title: "Normal admin management",
                icon: "flaticon-businesswoman",
                root: true,
                bullet: "dot",
                page: "Users/normal-admin",
                permissionResource: 'admin-management',
                hideSupper: true
            },
            {
                title: "User management",
                page: "User/List/normal",
                icon: "flaticon-avatar",
                root: true,
                permissionResource: 'user-management'
            },
            {
                title: "Business management",
                root: true,
                icon: "flaticon-suitcase",
                bullet: "dot",
                page: "Business/List",
                hiddenSub: true,
                permissionResource: 'business-management',
                submenu: [
                    {
                        root: true,
                        icon: "flaticon-suitcase",
                        title: "Business management",
                        page: "Business/Detail",
                    }
                ]
            },
            {
                title: "Emoji management",
                root: true,
                icon: "flaticon-list-3",
                bullet: "dot",
                permissionResource: 'emoji-management',
                submenu: [
                    {
